let exe_paths = [];
const drvs = drives();
const yara_rules = file("rules.yara");

function parseYaraRules(yaraRules) {
    const ruleRegex = /rule\s+(\w+)\s*{\s*meta:\s*([^}]+)\s*strings:/g;
    const metaRegex = /(\w+)\s*=\s*"([^"]+)"/g;
    let match;
    const result = {};
    
    while ((match = ruleRegex.exec(yaraRules)) !== null) {
        const ruleName = match[1];
        const metaString = match[2];
        
        const meta = {};
        let metaMatch;
        while ((metaMatch = metaRegex.exec(metaString)) !== null) {
            meta[metaMatch[1]] = metaMatch[2];
        }
        
        result[ruleName] = meta;
    }
    
    return result;
}

function findObjectByKey(obj, key) {
    return obj[key];
}

function colorLog(message, isYaraMatch = false) {
    if (isYaraMatch) {
        log("\x1b[31m" + message + "\x1b[0m");
    } else {
        log(message);
    }
}

const yara_meta = parseYaraRules(yara_rules);
let imGuiApps = []; 
let mapperApps = []; 

subDirs("C:/").forEach(dir => {
    if (dir != "Windows") {
        drvs.push("C:/" + dir);
    }
});

drvs.forEach(drv => {
    if (drv === "C:/") return;
    
    walk(drv, (path) => {
        const fileName = path.split('\\').pop().toLowerCase();
        const suspiciousExecutables = ['vgk.exe', 'vgc.exe', 'beservice_x64.exe'];
        
        if (path.endsWith(".exe") || path.endsWith(".dll") && !suspiciousExecutables.includes(fileName)) {
            exe_paths.push(path);
        }
    });
});

walk((uninstallDir("FiveM") + "\\FiveM.app\\plugins"), (path) => {
