let count_valid = 0;
let count_yara_matches = 0;
let detectionlogs = {};

exe_paths.forEach(entry => {
    let exe_filesize = fileSize(entry);
    
    count_total++;
    if (exe_filesize > 500000 && exe_filesize < 70000000) {
        count_valid++;
        let yara_result = yara(entry, yara_rules);
        
        if (yara_result && yara_result.length > 0) {
            count_yara_matches += yara_result.length;
            
